import React from "react";
import perfilCircular from "../Img/perfilCircular.png";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-12">
          <p className="text-contact fs-1">Contact</p>
        </div>
      </div>
      <div className="row container-contact ">
        <div className="col-3 bg-primary">
          <img
            src={perfilCircular}
            alt="..."
            className="img-fluid h-img-perfil"
          />
          <span className="col-12">Ricardo Ramirez</span>
        </div>
        <div className="col bg-success">contenido</div>
      </div>
    </div>
  );
};

export default Contact;
